    let lower_bound = 10;
    let upper_bound = 20;

    // Calculate the sum of all even integers between lower_bound and upper_bound
    let sum = (lower_bound..upper_bound).filter(|x| x % 2 == 0).sum();

    println!("The sum of all even integers between {} and {} is {}", lower_bound, upper_bound, sum);
